//SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";

contract ToonNFT is ERC721 {
    uint256 public tokenCounter;
    address public gameContract;
    address public owner;
    mapping (uint256 => uint256) public tokenIdToWinPower;
    mapping (uint256 => uint256) public winPowerToTokenId;

    constructor () public ERC721 ("ToonNFT", "TNT") {
        tokenCounter = 0;
        owner = msg.sender;
    }

    function setGameContract(address _gameContract) public {
        require(msg.sender == owner, "Only owner can set game contract.");
        gameContract = _gameContract;
    }

    function createCollectible (uint256 _winPower, address player) public returns (uint256) {
        require(msg.sender == gameContract || msg.sender == owner, "Only owner can create collectible");
        require(winPowerToTokenId[_winPower] == 0, "The winPower is not unique");
        tokenCounter = tokenCounter + 1;
        _safeMint(player, tokenCounter);
        tokenIdToWinPower[tokenCounter] = _winPower;
        winPowerToTokenId[_winPower] = tokenCounter;
        return tokenCounter;  
    }
}
